    import './Logo.css';
    import React from 'react';
    import logo from '../assets/imgs/logo.png'    
    import { Link } from 'react-router-dom';

    export default props =>
        <aside className='logo'>
            <Link to="/" className='logo'>
                <img src={logo} alt="logo" style/>
            </Link>
        </aside>
